ISLAMABAD, Mar 28 (APP): United Kingdom High Commissioner to Pakistan Jane Marriott called on Minister for Foreign Affairs Ishaq Dar on Thursday and discussed various aspects of bilateral relations and regional developments.
They agreed to further advance bilateral cooperation between Pakistan and the United Kingdom in all areas of mutual interest, including trade and investment, peace, security, and development cooperation.
